// src/actions/authActions.ts

import { LOGIN, LOGOUT, UPDATE_USER, AuthActionTypes, User } from '../types';

export const login = (user: User): AuthActionTypes => ({
  type: LOGIN,
  payload: user,
});

export const logout = (): AuthActionTypes => ({
  type: LOGOUT,
});

export const updateUser = (user: Partial<User>): AuthActionTypes => ({
  type: UPDATE_USER,
  payload: user,
});
